import React from "react";

const Panel = ({
  w,
  convex = false,
  concave = false,
  children,
  row = true,
}) => {
  return (
    <div className={`pnl-ctn pnl-ctn-${w}`}>
      <div
        className={`pnl ${convex ? "convex" : concave ? "concave" : ""} ${
          row ? "flx-row" : "fl-clmn"
        }`}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
